INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "アヤネ", 24001, 24, 0.0, "2020/07/31 12:00:00", 401, 0.0, 2, 102301, 2, 10046, "2030/12/17 14:59:59", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.21, "アヤネ", 24002, 24, 0.0, "2020/07/31 12:00:00", 402, 0.0, 2, 102301, 1, 10046, "2030/12/17 14:59:59", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "アヤネ", 24003, 24, 0.0, "2020/07/31 12:00:00", 403, 0.0, 2, 102301, 2, 10046, "2030/12/17 14:59:59", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (1.99, "アサヒ", 24004, 24, 0.0, "2020/07/31 12:00:00", 701, 0.0, 1, 192201, 2, 10046, "2030/12/17 14:59:59", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.21, "アサヒ", 24005, 24, 0.0, "2020/07/31 12:00:00", 702, 0.0, 2, 192201, 1, 10046, "2030/12/17 14:59:59", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.33, "アサヒ", 24006, 24, 0.0, "2020/07/31 12:00:00", 703, 0.0, 1, 192201, 2, 10046, "2030/12/17 14:59:59", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "部員３", 24007, 24, 0.0, "2020/07/31 12:00:00", 801, 0.0, 2, 192301, 2, 10046, "2030/12/17 14:59:59", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.68, "部員３", 24008, 24, 0.0, "2020/07/31 12:00:00", 802, 0.0, 2, 192301, 1, 10046, "2030/12/17 14:59:59", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "部員３", 24009, 24, 0.0, "2020/07/31 12:00:00", 803, 0.0, 2, 192301, 2, 10046, "2030/12/17 14:59:59", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "", 24010, 24, 0.0, "2020/07/31 12:00:00", 501, 0.0, 1, 192501, 1, 10046, "2030/12/17 14:59:59", "やった！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "", 24011, 24, 0.0, "2020/07/31 12:00:00", 502, 0.0, 1, 192501, 1, 10046, "2030/12/17 14:59:59", "勝ったよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "", 24012, 24, 0.0, "2020/07/31 12:00:00", 503, 0.0, 1, 192501, 1, 10046, "2030/12/17 14:59:59", "いい調子！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (5.33, "ミサト", 24013, 24, 0.0, "2020/07/31 12:00:00", 111, 0.0, 2, 113501, 6, 10046, "2030/12/17 14:59:59", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (6.85, "ミサト", 24014, 24, 0.0, "2020/07/31 12:00:00", 112, 0.0, 2, 113501, 1, 10046, "2030/12/17 14:59:59", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.0, "ミサト", 24015, 24, 0.0, "2020/07/31 12:00:00", 113, 0.0, 2, 113501, 1, 10046, "2030/12/17 14:59:59", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (6.11, "ダイチ", 24016, 24, 0.0, "2020/07/31 12:00:00", 611, 0.0, 2, 192401, 1, 10046, "2030/12/17 14:59:59", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (6.75, "ダイチ", 24017, 24, 0.0, "2020/07/31 12:00:00", 612, 0.0, 2, 192401, 1, 10046, "2030/12/17 14:59:59", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "ダイチ", 24018, 24, 0.0, "2020/07/31 12:00:00", 613, 0.0, 2, 192401, 2, 10046, "2030/12/17 14:59:59", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (4.52, "ハツネ", 24019, 24, 0.0, "2020/07/31 12:00:00", 211, 0.0, 1, 113401, 2, 10046, "2030/12/17 14:59:59", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.89, "ハツネ", 24020, 24, 0.0, "2020/07/31 12:00:00", 212, 0.0, 1, 113401, 2, 10046, "2030/12/17 14:59:59", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (13.49, "ハツネ", 24021, 24, 0.0, "2020/07/31 12:00:00", 213, 0.0, 2, 113401, 1, 10046, "2030/12/17 14:59:59", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.17, "カヤ", 24022, 24, 0.0, "2020/07/31 12:00:00", 311, 0.0, 2, 106501, 1, 10046, "2030/12/17 14:59:59", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (4.42, "カヤ", 24023, 24, 0.0, "2020/07/31 12:00:00", 312, 0.0, 2, 106501, 1, 10046, "2030/12/17 14:59:59", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (2.89, "カヤ", 24024, 24, 0.0, "2020/07/31 12:00:00", 313, 0.0, 1, 106501, 6, 10046, "2030/12/17 14:59:59", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (3.71, "アヤネ", 24025, 24, 0.0, "2020/07/31 12:00:00", 421, 0.0, 3, 102301, 4, 10046, "2030/12/17 14:59:59", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (5.1, "アサヒ", 24026, 24, 0.0, "2020/07/31 12:00:00", 721, 0.0, 1, 192201, 2, 10046, "2030/12/17 14:59:59", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (4.34, "部員３", 24027, 24, 0.0, "2020/07/31 12:00:00", 821, 0.0, 3, 192301, 1, 10046, "2030/12/17 14:59:59", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "", 24028, 24, 0.0, "2020/07/31 12:00:00", 521, 0.0, 1, 192501, 1, 10046, "2030/12/17 14:59:59", "いい勝負だったよ\nまたやろうね");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (5.62, "ミサト", 24029, 24, -360.0, "2020/07/31 12:00:00", 101, 0.0, 2, 113501, 1, 10046, "2030/12/17 14:59:59", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (9.58, "ミサト", 24030, 24, -360.0, "2020/07/31 12:00:00", 102, 0.0, 2, 113501, 1, 10046, "2030/12/17 14:59:59", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (0.0, "ミサト", 24031, 24, -360.0, "2020/07/31 12:00:00", 103, 0.0, 2, 113501, 2, 10046, "2030/12/17 14:59:59", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (9.13, "ミサト", 24032, 24, -360.0, "2020/07/31 12:00:00", 104, 0.0, 1, 113501, 2, 10046, "2030/12/17 14:59:59", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！");
INSERT INTO `v1_f9b1ce6c184f985a0950d0a75902290af0ac79b0db45e82fcb290cd9344111c5` VALUES (8.27, "ミサト", 24033, 24, -360.0, "2020/07/31 12:00:00", 105, 0.0, 2, 113501, 1, 10046, "2030/12/17 14:59:59", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！");
